import React, { Component } from 'react';

class Social extends Component {
    render() {
        return (
            <div class="social">
            <div class="btnsame btn1">
				<a href="https://github.com/vikalp2502" target="_blank"><i class="fa fa-github"></i></a>
			</div>
			<div class="btnsame btn2">
				<a href="https://twitter.com/@kaushik_vikalp" target="_blank"><i class="fa fa-twitter"></i></a>
			</div>
			<div class="btnsame btn3">
				<a href="https://linkedin.com/in/vikalp-kaushik-99966a1ab" target="_blank"><i class="fa fa-linkedin"></i></a>
			</div>
			<div class="btnsame btn4">
				<a href="https://instagram.com/vikalp._.kaushik" target="_blank"><i class="fa fa-instagram"></i></a>
			</div>
            </div>
            )
        }
    }
    
export default Social
